'use strict';
let MessageType = require('./MessageType.js');
let ClosedPositionsList = require('./ClosedPositionsList.js');
class GetClosedPositionsMessage {
    closedPositionsList;
    constructor() {
        this.closedPositionsList = new ClosedPositionsList();
    }
    getClosedPositions() {
        return this.closedPositionsList.toArray();
    }
    getType() {
        return MessageType.GetClosedPositions;
    }
}
module.exports = GetClosedPositionsMessage
